import React, { useEffect, useRef, useState } from 'react';
import { Link } from 'react-router-dom';
import { motion, useAnimation, useViewportScroll, useTransform } from 'framer-motion';

function Index() {
  const controls = useAnimation();
  const bgRef = useRef(null);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const { scrollYProgress } = useViewportScroll();
  const yPosAnim = useTransform(scrollYProgress, [0, 1], [0, 100]);

  useEffect(() => {
    controls.start({
      opacity: [0.5, 1, 0.5],
      scale: [1, 1.05, 1],
      transition: { duration: 5, repeat: Infinity, ease: "easeInOut" }
    });

    const handleMouseMove = (e) => {
      const { clientX, clientY } = e;
      const { width, height } = bgRef.current.getBoundingClientRect();
      setMousePosition({ x: clientX / width, y: clientY / height });
    };

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, [controls]);

  const gradientStyle = {
    background: `radial-gradient(circle at ${mousePosition.x * 100}% ${mousePosition.y * 100}%, rgba(255,255,255,0.2) 0%, transparent 50%)`,
  };

  return (
    <div ref={bgRef} className="min-h-screen w-full bg-gradient-to-br from-indigo-900 via-purple-800 to-pink-700 text-white overflow-hidden relative">
      <div className="absolute inset-0 pointer-events-none" style={gradientStyle}></div>
      <svg className="absolute inset-0 w-full h-full" xmlns="http://www.w3.org/2000/svg">
        <defs>
          <pattern id="grid" width="40" height="40" patternUnits="userSpaceOnUse">
            <path d="M 40 0 L 0 0 0 40" fill="none" stroke="rgba(255,255,255,0.1)" strokeWidth="1"/>
          </pattern>
        </defs>
        <rect width="100%" height="100%" fill="url(#grid)" />
      </svg>

      <motion.div 
        className="fixed top-0 left-0 w-1 h-full bg-gradient-to-b from-pink-500 to-blue-500"
        style={{ scaleY: scrollYProgress }}
      />

      <section className="h-screen flex flex-col justify-center items-center relative z-10">
        <motion.div
          initial={{ opacity: 0, y: -50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1.2 }}
          className="text-center relative"
        >
          <motion.h1 
            className="text-9xl font-extrabold mb-4 text-transparent bg-clip-text bg-gradient-to-r from-pink-400 via-purple-400 to-blue-500"
            animate={{ rotate: [0, 5, -5, 0] }}
            transition={{ duration: 10, repeat: Infinity, ease: "easeInOut" }}
          >
            TokTok
          </motion.h1>
          <p className="text-3xl font-light tracking-wide">
            Exclusive Software for Extraordinary People
          </p>
          <motion.div
            className="absolute -top-20 -right-20 w-40 h-40 bg-blue-500 rounded-full mix-blend-multiply filter blur-xl opacity-70"
            animate={{ scale: [1, 1.2, 1], rotate: [0, 90, 0] }}
            transition={{ duration: 8, repeat: Infinity, ease: "easeInOut" }}
          />
          <motion.div
            className="absolute -bottom-20 -left-20 w-40 h-40 bg-pink-500 rounded-full mix-blend-multiply filter blur-xl opacity-70"
            animate={{ scale: [1.2, 1, 1.2], rotate: [0, -90, 0] }}
            transition={{ duration: 8, repeat: Infinity, ease: "easeInOut" }}
          />
        </motion.div>
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.5 }}
          className="mt-12"
        >
          <Link to="#explore" className="text-xl border-2 border-white px-6 py-3 rounded-full hover:bg-white hover:text-purple-800 transition duration-300 relative overflow-hidden group">
            <span className="relative z-10">Explore TokTok</span>
            <motion.div
              className="absolute inset-0 bg-gradient-to-r from-pink-500 to-purple-500"
              initial={{ x: '-100%' }}
              whileHover={{ x: 0 }}
              transition={{ duration: 0.3 }}
            />
          </Link>
        </motion.div>
      </section>

      <motion.section 
        id="explore" 
        className="min-h-screen flex flex-col justify-center items-center py-20"
        style={{ y: yPosAnim }}
      >
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 1 }}
          className="text-center mb-16"
        >
          <h2 className="text-6xl font-bold mb-4 relative inline-block">
            Join Our Elite Circle
            <motion.div
              className="absolute -bottom-2 left-0 w-full h-1 bg-gradient-to-r from-pink-500 to-blue-500"
              initial={{ scaleX: 0 }}
              whileInView={{ scaleX: 1 }}
              transition={{ duration: 0.8, delay: 0.2 }}
            />
          </h2>
          <p className="text-xl max-w-2xl mx-auto">
            TokTok creates bespoke software solutions for a select group of visionaries. 
            Our invitation-only platform pushes the boundaries of what's possible in the digital realm.
          </p>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, scale: 0.9 }}
          whileInView={{ opacity: 1, scale: 1 }}
          transition={{ duration: 1, delay: 0.3 }}
          className="grid grid-cols-1 md:grid-cols-2 gap-12 max-w-6xl w-full px-8"
        >
          <motion.div
